import React from 'react';
import { Diff, Hunk, parseDiff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const oldCode = `
function MyComponent() {
  return <div>Hello, old world!</div>;
}
`;

const newCode = `
function MyComponent() {
  return <div>Hello, new world!</div>;
}
`;

const diffText = `
--- oldCode
+++ newCode
@@ -1,5 +1,5 @@
 function MyComponent() {
- return <div>Hello, old world!</div>;
+  return <div>Hello, new world!</div>;
 }
`;


const CodeDiffViewer = ({ oldCode, newCode }) => {
    // Assuming oldCode and newCode are strings containing the code snippets
    return (
      <div>
        <h2>Code Differences</h2>
        <Diff
          viewType="split"
          oldValue={oldCode}
          newValue={newCode}
          splitView={true}
          highlightLines={true}
          hideLineNumbers={false}
          showDiffOnly={false}
        />
      </div>
    );
  };
  
  export default CodeDiffViewer;
